import axios from "axios";


 export default{
    createGame: (gameName) => {
        console.log("Running the browser");
        return axios.post("/api/newgame", {gameName: gameName});
    },
    pullGame: (gameID) => {
        return axios.get("api/getgame", {_id: gameID});
    }
 };//END export default
